import React from 'react';

import './index.css';

function Cards(props) {
    console.log(props)
    return (

        <div>
            <div className="cardblock">  
                <a href={props.links}> <img src={props.imgsrc} alt="Netflix Properties"/></a>                
            </div>
            <h3>{props.sname}</h3>
        </div>
    );
}

export default Cards;
